import React, {useState, useEffect}from 'react'

function ClientRegistration() {

  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [address, setAddress] = useState('');

  return (
    <div>
        <div className='row justify-content-center mt-5'>
          <div>
            <div>
              <h3>Complete the following data:</h3>
              <input type="text" className='form-control mt-1' placeholder='name'
              value={name} onChange={(e) => {setName(e.target.value)}}/>
              <input type="text" className='form-control mt-1' placeholder='email' />
              <input type="text" className='form-control mt-1' placeholder='phone-number' />
              <input type="text" className='form-control mt-1' placeholder='address' />
            </div>
          </div>
        </div>
    </div> 
  )
}

export default ClientRegistration
